import React from "react";
import "./../css/About.css";

const SuggestEdit = () => (
  <main className="main-container">
    <div className="submit-container">
      <iframe
        src="https://docs.google.com/forms/d/e/1FAIpQLSdhl3vDaK-Rkh-yLB5A0Vj5FJFPcgVTz81zA-xx0Gt_Mg7soA/viewform?embedded=true"
        width="100%"
        height="100%"
        frameBorder="0"
        marginHeight="0"
        marginWidth="0"
        title="suggested update form"
      ></iframe>
    </div>
  </main>
);

export default SuggestEdit;
